  render() {
    return (
      <StripeCheckout
        name="WDIDW"
        description="$5 for 5 email credits."
        amount={500}
        token={(token) => {
          console.log(token);
        }}
        stripeKey={process.env.REACT_APP_STRIPE_KEY}
      />
    );
  }
}

export default Payments;
